function addEmployeeToTeam(employee, team) {
  var team = JSON.stringify(team);
  localStorage.setItem("currentTeam", team);
  console.log(employee.Name, "Suraaaaaaa");
  console.log(team.Name, "111111111");
}
export default { addEmployeeToTeam };
